import React from "react";
import ProjectGrid from "../components/ProjectGrid";
import { motion } from "framer-motion/dist/framer-motion";

const Projects = () => {
    return (
    <motion.div
        initial = {{width: 0}}
        animate = {{width: "100%"}}
        exit = {{x: window.innerWidth, transition: {duration: 0.1}}}>

        <ProjectGrid/>
    </motion.div>
    )
}

export default Projects
